    try {
        const tarjeta = await Tarjeta.findByIdAndUpdate(req.params.tarjetaId, req.body, {
            new:true
        })  
        console.log(tarjeta)
        res.render('pages/updateTarjeta', {tarjeta})
    } catch (error) {
        console.log(error)
    }

}

